(107,	1,	'2024-01-28 11:18:31',	'2024-01-28 11:18:31',	'Mountain Retreat in Lake Arrowhead BEING SOLD WITH ADDITIONAL ADJACENT LOT 866 Lake Arrowhead Drive. Welcome to your serene mountain retreat nestled on 2 spacious lots in the heart of Lake Arrowhead. This mountain chalet boasts awe-inspiring mountain views and seasonal glimpses of the pristine lake, making it the perfect escape for nature enthusiasts and those seeking tranquility. As you arrive, you\'ll be greeted by a circular driveway that offers ample parking space for your guests, setting the stage for a warm and inviting experience. The open floor plan is bathed in natural light, thanks to the ceiling-to-floor windows that frame the picturesque surroundings. Vaulted ceilings add to the sense of spaciousness, creating a truly immersive mountain living experience. This home is designed for cozy gatherings and relaxation, with two masonry fireplaces strategically placed in the living areas. The main level features a master suite, providing ultimate convenience and privacy. Step outside onto one of the two full decks, one off the master bedroom and the other off the guest bedroom, both perfect for sipping your morning coffee Additionally, access to the decks can be found from the great room, creating a seamless indoor-outdoor flow. The heart of this home is the large country kitchen, complete with white cabinetry and an abundance of workspace. It\'s an ideal setting for culinary adventures and family meals. The eat-in kitchen area and a back deck off the kitchen allow for dining options that cater to your lifestyle. The lower level offers a generous finished terrace level with a full bath, offering versatile space for recreation, entertainment, or additional sleeping accommodations. This mountain chalet offers not just a home but a lifestyle. Whether you\'re seeking a serene weekend getaway or a year-round residence, this property provides the perfect canvas for creating cherished memories in a natural setting. Escape the hustle and bustle and make this Lake Arrowhead retreat your own. Don\'t miss the opportunity to experience the beauty and tranquility this home has to offer. Schedule a showing today and let this mountain chalet captivate your heart. Your mountain oasis awaits!',	'862 Lake Arrowhead Dr, Waleska, GA 30183',	'',	'publish',	'closed',	'closed',	'',	'862-lake-arrowhead-dr-waleska-ga-30183',	'',	'',	'2024-01-28 11:30:51',	'2024-01-28 11:30:51',	'',	0,	'http://sample-project.local/?post_type=property&#038;p=107',	0,	'property',	'',	0),
