(109,	1,	'2024-01-28 11:36:05',	'2024-01-28 11:36:05',	'Rarely available in highly sought-after Fairway Trace at Peridia Golf and Country Club Community! One of the most beautiful locations in Peridia and surrounding areas. Enjoy the sunrise from the front porch overlooking the pool and hot tub just a few steps away from your condo and enclosed garage. Then enjoy the stunning sunsets overlooking Peridia\'s largest lake from your lanai. This partially furnished second-story home features vaulted ceilings, hurricane windows, new stainless steel appliances, and a garbage disposal. Two bedrooms, 2 full baths, and a lanai that converts to a third sleeping area give you plenty of space to make memories, entertain those dearest to you, and live the Florida dream. You will always have something to do and enjoy when you live close to one of the highest-rated Golf Courses in Bradenton, the Clubhouse, Tiki Bar, Tennis Courts, pickleball, and even a library! Health Services, shopping, veterinarian, and your choice of fabulous restaurants are all within a mile of you. Daily specials, events, and discounted golf are a few more perks to owning in this community! All are welcome and you could make some new friends too! Parking is never an issue as you have your own enclosed garage as well. Peridia is an Oasis close to I-75 and 70. Don\'t miss this opportunity to enjoy maintenance free living!',	'Buildable plan: Lazio, Esplanade at The Heights, Bradenton, FL 34203',	'',	'publish',	'closed',	'closed',	'',	'buildable-plan-lazio-esplanade-at-the-heights-bradenton-fl-34203',	'',	'',	'2024-01-28 11:58:56',	'2024-01-28 11:58:56',	'',	0,	'http://sample-project.local/?post_type=property&#038;p=109',	0,	'property',	'',	0),
