(112,	1,	'2024-01-28 11:51:34',	'2024-01-28 11:51:34',	'Pre-Construction. To be built. Welcome to Palma Sola Grande an exclusive, boutique gated community in West Bradenton featuring sixteen new construction homes near Palma Sola Bay. You can choose from 4 different models with 3 package options or bring your own builder. If you chose from our models, estimated completion time is 12 months! If you choose to bring your own builder (limited amount of lots available) the home must be approved by ARC board and be a Key West beachy style. The 4 cul-de-sac lots are design build or bring your own builder. The Key Model is a coastal contemporary single-story home with a spacious great room, gourmet kitchen, and private primary suite. The light and airy open-concept floor plan was built to entertain, with brilliant natural light pouring into the expansive living space and shining throughout the home. The kitchen is perfect for cooking and entertaining, featuring stainless-steel appliances. The private primary suite features a roomy walk-in closet, ensuite bathroom featuring a freestanding soaking tub and a spacious walk-in shower with glass enclosure and sleek finishes. Other features include an oversized two car garage, metal roof system, and hurricane impact-resistant windows and doors. The front yard and the fenced backyard feature lush low maintenance tropical landscaping. You will love the ideal location with close proximity to the Gulf Beaches of Anna Maria Island, Robinson Preserve, Historic DeSoto National Park, IMG Academy and Golf Club, downtown Bradenton, St. Pete, the cultural and culinary arts of Sarasota, shopping, stores, restaurants, and medical facilities. Walk or ride bikes to the Robinson Preserve, a 682-acre nature preserve offering trails, kayak launches, and a picnic area. This is the ultimate Florida lifestyle location! Contact us to set up a tour and experience the beauty and lifestyle firsthand before the community sells out! Sales and Design Center open Monday thru Saturday 11am-3pm. We recommend making an appointment even during our open hours. *This is the Vista Model Specs*',	'8009 20th Pl W, Bradenton, FL 34209',	'',	'publish',	'closed',	'closed',	'',	'8009-20th-pl-w-bradenton-fl-34209',	'',	'',	'2024-01-28 11:51:34',	'2024-01-28 11:51:34',	'',	0,	'http://sample-project.local/?post_type=property&#038;p=112',	0,	'property',	'',	0),
