(114,	1,	'2024-01-28 11:55:52',	'2024-01-28 11:55:52',	'Fantastic opportunity to own a first story end unit in Burgundy Condominiums! Enter into this open and inviting floorplan that gives the opportunity to easily entertain. The lanai offers a peaceful atmosphere to relax day or evening. This community offers amenities such as a clubhouse, pool, laundry facilities and a tennis court! This wonderful condo is located close to Greens of Manatee Golf Course and to public transportation. This building had a new roof put on in 2023. Perfect property to live in or lease out! Please reach out with any questions!           It is a less than 20 minute drive to beautiful Bradenton beaches!',	'203 46th Avenue Ter W APT 237, Bradenton, FL 34207',	'',	'publish',	'closed',	'closed',	'',	'203-46th-avenue-ter-w-apt-237-bradenton-fl-34207',	'',	'',	'2024-01-28 11:55:52',	'2024-01-28 11:55:52',	'',	0,	'http://sample-project.local/?post_type=property&#038;p=114',	0,	'property',	'',	0),
