(116,	1,	'2024-01-28 11:57:32',	'2024-01-28 11:57:32',	'HONEY STOP THE CAR!!! Welcome to your new home in the beautiful Palms of Cortez community! This charming 2-bedroom, 2-bathroom condominium offers a perfect blend of comfort and convenience, featuring updated luxury vinyl planking throughout.    As you step into the unit, you are greeted by an open and airy living space with ample natural light, creating a warm and inviting atmosphere. The updated luxury vinyl planking adds a touch of elegance and durability to the interior, providing a modern and low-maintenance flooring solution. NO CARPET!!!    The well-appointed kitchen features modern appliances, sleek countertops, and plenty of cabinet space, making it a joy to prepare meals and entertain guests. The master suite is a peaceful retreat, complete with a spacious layout, a walk-in closet, and an en-suite bathroom for added privacy and comfort. The second bedroom is versatile and can be used as a guest room, office, or hobby space, offering flexibility to suit your lifestyle.    The screened lanai is an ideal spot to enjoy your morning coffee or unwind after a long day, providing a tranquil outdoor setting. The unit also includes a laundry room with a washer and dryer for added convenience.    The Palms of Cortez community amenities include a clubhouse, fitness center, swimming pool, and tennis courts, offering residents a resort-style living experience. With its prime location in Bradenton, you\'re just minutes away from the area\'s beautiful beaches, shopping, dining, and entertainment options.    Don\'t miss the opportunity to make this wonderful condominium your own and enjoy the best of Florida living! Schedule your showing today and experience all that 4802 51st St W #1017 has to offer.',	'4802 51st St W APT 1017, Bradenton, FL 34210',	'',	'publish',	'closed',	'closed',	'',	'4802-51st-st-w-apt-1017-bradenton-fl-34210',	'',	'',	'2024-01-28 11:57:32',	'2024-01-28 11:57:32',	'',	0,	'http://sample-project.local/?post_type=property&#038;p=116',	0,	'property',	'',	0),
