(118,	1,	'2024-01-28 13:24:45',	'2024-01-28 13:24:45',	'One or more photo(s) has been virtually staged. One or more photo(s) has been virtually staged.  Welcome to City Homes at Cypress Walk! This unit is new and has never been lived in and has many upgrades including upgraded master shower, upgraded flooring throughout, and upgraded fixtures in the master bathroom.  This Community is comprised of 29 Townhome style, land owned condos. There are 4 units per building offering a feeling of independence and privacy. Situated on a beautiful pond with natural Florida plants and mature trees you will feel like you are a hundred miles away from the hustle and bustle. The community offers a convenient location as a main feature, just a couple miles from historic downtown Bradenton where you can enjoy farmers markets, festivals and wonderful restaurants for every taste! If nightlife is your thing then you will find the area is perfect for searching for your favorite craft beer at Motorworks, Darwins, 3 Keys, 3 Car Garage Brewing Company or the Naughty Monk just to name a few. Soon the amazing Riverwalk of Bradenton will be extended East where you can stroll the river, exercise in an amazing outdoor venue on the Historic Manatee River. Each Cityhome features 2 Bedrooms, 2 Full baths, and a single car garage, call today for a list of wonderful features and availability. Fees, Taxes and final rules are subject to change but will be guaranteed prior to closing, room sizes are approximate based on plans. This project is not eligible for FHA or Conventional financing.',	'2513 6th Avenue Dr E #4, Bradenton, FL 34205',	'',	'publish',	'closed',	'closed',	'',	'2513-6th-avenue-dr-e-4-bradenton-fl-34205',	'',	'',	'2024-01-28 13:24:45',	'2024-01-28 13:24:45',	'',	0,	'http://sample-project.local/?post_type=property&#038;p=118',	0,	'property',	'',	0),
