(122,	1,	'2024-01-28 13:27:20',	'2024-01-28 13:27:20',	'Embrace the Florida lifestyle in this charming 3 bedroom 2 bath home in NW Bradenton. Nestled near Robinson\'s Preserve and Desoto Memorial. Anna Maria Island is just 5 miles down the road. This residence sits on an expansive 1/3 acre lot providing a canvas for creating something truly special outdoors.  While it awaits your personal touch with updates, its prime location and potential make it a perfect combination for creating your dream home. Special features include Vaulted Ceilings, Wood burning Fireplace and Split Floor Plan. There are No Deed Restrictions here, No Flood Zone and A-Rated Stewart Elementary School is at the end of your street. Plenty of room for all your toys, boats, RV, etc. Don\'t miss the opportunity to call this incredible property your home.',	'7803 15th Ave NW, Bradenton, FL 34209',	'',	'publish',	'closed',	'closed',	'',	'7803-15th-ave-nw-bradenton-fl-34209',	'',	'',	'2024-01-28 13:27:20',	'2024-01-28 13:27:20',	'',	0,	'http://sample-project.local/?post_type=property&#038;p=122',	0,	'property',	'',	0),
